pragma solidity ^0.6.0;
import "./Token.sol";

contract EthSwap {
  beeToken public token;
  uint256 private buyrate = 9;
  uint256 private fee;
  uint256 private sellrate = 10;
  address private fundAddress = 0x9485e4E87D834523Dc9481Fb4EfaE7bb07a2b862;

  event beesPurchased(address account,address token,uint amount,uint buyrate);

  event beesSold(address account,address token,uint amount,uint sellrate);

  constructor(beeToken _token) public {
    token = _token;
  }



  function buybees() public payable {
    uint beeAmount = msg.value * buyrate;
    fee = beeAmount / 1000;
    require(token.balanceOf(address(this)) >= beeAmount);

    token.transfer(msg.sender, beeAmount);
    token.transfer(fundAddress, fee);
    emit beesPurchased(msg.sender, address(token), beeAmount, buyrate);
  }

  function sellbees(uint _amount) public {
    require(token.balanceOf(msg.sender) >= _amount);

    uint etherAmount = _amount / sellrate;

    require(address(this).balance >= etherAmount);

    token.transferFrom(msg.sender, address(this), _amount);
    msg.sender.transfer(etherAmount);

    emit beesSold(msg.sender, address(token), _amount, sellrate);
  }

}
